(30, 55, 30, 'Neda', '2013-09-30 22:00:00', '2013-10-06 20:00:00', 'Nedeljkov je na Kamp u Pancevo poslao 3 juniora i sva 3 su izleteli svih 7 trka od ukupno 1.500 km. ', 190, 'Pancevo', 55, 35, 5, 3),
