(33, 55, 33, 'G-ARDEN', '2013-09-30 22:15:00', '2013-10-06 20:00:00', 'Vicesampion Kampa juniora na trci iz Nisa u konkurenciji 208 golubova iz 9 Drzava.', 190, 'Pancevo', 55, 35, 5, 3),
(34, 55, 34, 'MLADJA', '2013-09-30 22:15:00', '2013-10-06 20:00:00', 'MLADJA je bio VICESAMPION KAMPA NA TRCI IZ ALEKSINCA izmedju 208 golubova, 62 odgajivaca-takmicara iz 9 Drzava. ', 190, 'Pancevo', 55, 35, 5, 25),
